      SELECT - - 87 + + col0 + - - col2 + + col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN NULL AND + 20 * + - col1 + - col0;
  - name: tab1

outputs:
  - name: q6065.out
    data: |
